def count_max_nines_pairs(n):
    if n <= 5:
        return n * (n - 1) // 2
    sum_n_n_minus_1 = n + (n - 1)
    l = len(str(sum_n_n_minus_1))
    if str(sum_n_n_minus_1) == l * '9':
        return 1
    res = 0
    s = (l - 1) * '9'
    for i in range(9):
        p = str(i) + s
        if int(p) <= n + 1:
            res += int(p) // 2
        elif int(p) > sum_n_n_minus_1:
            break
        else:
            res += 1 + (sum_n_n_minus_1 - int(p)) // 2
    return res

